IF OBJECT_ID('dbo.proc_transform_132', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_132;
GO
CREATE PROCEDURE dbo.proc_transform_132
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_132
    SET payload = LEFT(payload, 1000) + N'|V4-132|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_132;
END
GO
IF OBJECT_ID('dbo.audit_v4_132', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.audit_v4_132 (aid INT IDENTITY(1,1) PRIMARY KEY, msg NVARCHAR(2000), created_on DATETIME2 DEFAULT SYSUTCDATETIME());
END
GO
EXEC dbo.proc_transform_132;
